CREATE TABLE DBETL.DIPENDENTI
(
 COD_DIP             CHAR(6) PRIMARY KEY NOT NULL
,NOME                VARCHAR2(25)  NOT NULL
,INIZIALI            CHAR(2)
,COGNOME             VARCHAR2(25)  NOT NULL
,COD_UFF             CHAR(3)
,NUM_TEL_INTERNO     CHAR(4)
,DT_ASSUNZ           DATE
,RUOLO               CHAR(20)
,LIVELLO_ISTRUZIONE  NUMBER
,SESSO               CHAR(1)
,DT_NASCITA          DATE
,STIPENDIO           NUMBER(9,2)
,BONUS               NUMBER(9,2)
,COMMISSIONI         NUMBER(9,2)
) 
TABLESPACE TS_CORSO 
STORAGE (INITIAL 250K);

